Yes, but it requires understanding how the compiler breaks down the request.

"\"" + intToHexString(hashval, 8) + "\"";
is the line of code

which decomposes into something like

(OP std::string::operator+(const char*) (OP std::string::operator+(const char*)))

operator+ has move semantics, which doesn't require a string copy, and it can reuse the memory in the meantime.  If I had instead written

std::string quote = "\"";
quote + intToHexString(hashval, 8) + quote;

Clang would've triggered the warning.
